import ExpenseItem from "./ExpenseItem";
import ExpensesFilter from "./ExpensesFilter";
import './Expenses.css';
import Card from "../UI/Card";

function Expenses(props){
    const expenses = props.item;

    const filterHandler = (expenseFilterdata)=>{
        const expenseFilter ={expenseFilterdata,
            id:Math.random().toString()
        }
    console.log(expenseFilter);
    }

    return (
        <>
        <Card className="expenses">
            <ExpensesFilter filter={filterHandler}></ExpensesFilter>
            {
            expenses.map(
                expense =>
                <ExpenseItem  title={expense.title} amount={expense.amount} date={expenses.date}>  </ExpenseItem>
            )}
        </Card>
        </>
    )
}
export default Expenses;
